"use strict";(self.webpackChunkmaki=self.webpackChunkmaki||[]).push([[477],{10:t=>{t.exports=JSON.parse('{"blogPosts":[{"id":"starting-wiki-work","metadata":{"permalink":"/blog/starting-wiki-work","editUrl":"https://github.com/steviegt6/maki/tree/master/blog/2022-06-27-starting-wiki-work.md","source":"@site/blog/2022-06-27-starting-wiki-work.md","title":"Starting Wiki Work","description":"Today is the day I have decided to start working on this wiki. While a long road waits ahead and I am sure I will only be working on this periodically, I hope it benefits many.","date":"2022-06-27T00:00:00.000Z","formattedDate":"June 27, 2022","tags":[{"label":"wiki","permalink":"/blog/tags/wiki"}],"readingTime":0.68,"hasTruncateMarker":true,"authors":[{"name":"Tomat","title":"Developer & Maintainer","url":"https://github.com/steviegt6","imageURL":"https://github.com/steviegt6.png","key":"tomat"}],"frontMatter":{"slug":"starting-wiki-work","title":"Starting Wiki Work","authors":["tomat"],"tags":["wiki"]}},"content":"Today is the day I have decided to start working on this wiki. While a long road waits ahead and I am sure I will only be working on this periodically, I hope it benefits many.\\n\\n\x3c!--truncate--\x3e\\n\\nI hope that I\'ll be able to document various tools I create/use and write guides for things I use quite often. I am not sure how \\"professional\\" I want anything to be (we\'ll all have to see later).\\n\\nIdeally, I can get started on documenting the internals of tModLoader (and Terraria by extension) to make things easier for modders. Writing an assortment of guides, tutorials, and detailed pages explaining various inner-workings of the game and codebase would be wonderful.\\n\\nI\'ve been itching to write up some tutorials and explanations for IL editing and method detouring using [MonoMod](https://github.com/MonoMod/MonoMod) as well."}]}')}}]);